import React, { useEffect, useState } from 'react';
import api from '../services/api';

const PaymentsPage = () => {
  const [payments, setPayments] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchPayments = async () => {
      try {
        const token = localStorage.getItem('token');
        if (!token) {
          setError('‚ùå No token found, user not authenticated');
          setLoading(false);
          return;
        }

        const res = await api.get('/payments/user', {
          headers: { Authorization: `Bearer ${token}` }
        });
        setPayments(res.data);
      } catch (err) {
        console.error('‚ùå Failed to fetch payments:', err.response?.data || err.message);
        setError(err.response?.data?.error || 'Failed to fetch payments.');
      } finally {
        setLoading(false);
      }
    };

    fetchPayments();
  }, []);

  const handleStripeCheckout = async () => {
    try {
      const token = localStorage.getItem('token');
      if (!token) {
        setError('‚ùå No token found, cannot initiate Stripe checkout');
        return;
      }

      const res = await api.post('/payments/create-session', {}, {
        headers: { Authorization: `Bearer ${token}` },
      });

      if (res.data?.url) {
        window.location.href = res.data.url;
      } else {
        setError('‚ùå No Stripe URL returned.');
      }
    } catch (err) {
      console.error("Stripe session error:", err.response?.data || err.message);
      setError(err.response?.data?.error || 'Stripe session error.');
    }
  };

  return (
    <div style={page}>
      <h2 style={heading}>üí≥ Payments</h2>

      {loading ? (
        <p style={info}>Loading payments...</p>
      ) : error ? (
        <p style={errorMsg}>{error}</p>
      ) : payments.length === 0 ? (
        <p style={info}>No payments found.</p>
      ) : (
        <div style={list}>
          {payments.map((p, index) => (
            <div key={p.payment_id || index} style={card}>
              <p style={amount}>
                {new Intl.NumberFormat('en-US', {
                  style: 'currency',
                  currency: 'USD'
                }).format(p.amount)}
              </p>
              <p style={meta}>Paid on: {new Date(p.paid_date).toLocaleDateString()}</p>
              <p style={meta}>Payment ID: {p.payment_id}</p>
            </div>
          ))}
        </div>
      )}

      <button onClick={handleStripeCheckout} style={payButton}>
        Pay Now with Stripe
      </button>
    </div>
  );
};

/* üé® Styles */
const page = {
  padding: '2rem',
  maxWidth: '720px',
  margin: '0 auto',
  fontFamily: 'Segoe UI, sans-serif'
};

const heading = {
  fontSize: '1.75rem',
  fontWeight: '600',
  marginBottom: '1.5rem',
  color: '#111'
};

const info = {
  fontSize: '1rem',
  color: '#555'
};

const errorMsg = {
  fontSize: '1rem',
  color: '#dc2626',
  fontWeight: '500'
};

const list = {
  display: 'grid',
  gridTemplateColumns: 'repeat(auto-fill, minmax(280px, 1fr))',
  gap: '1rem',
  marginBottom: '2rem'
};

const card = {
  backgroundColor: '#fff',
  borderRadius: '10px',
  boxShadow: '0 2px 6px rgba(0,0,0,0.08)',
  padding: '1rem',
  display: 'flex',
  flexDirection: 'column',
  gap: '0.4rem'
};

const amount = {
  fontSize: '1.2rem',
  fontWeight: '600',
  color: '#111'
};

const meta = {
  fontSize: '0.9rem',
  color: '#555'
};

const payButton = {
  padding: '0.75rem 1.5rem',
  backgroundColor: '#111',
  color: '#fff',
  border: 'none',
  borderRadius: '8px',
  fontWeight: '600',
  fontSize: '1rem',
  cursor: 'pointer',
  transition: 'background-color 0.2s ease'
};

export default PaymentsPage;
